    n, m = map(int, stdin.split()[:2])
    edges = []
    for i in range(m):
        u, v, w = map(int, stdin.split()[3*i+2:3*i+5])
        edges.append((u, v, w))

    def find_mst(edges):
        edges.sort(key=lambda x: x[2])
        parent = [i for i in range(n+1)]
        rank = [0] * (n+1)
        def find(u):
            if parent[u] != u:
                parent[u] = find(parent[u])
            return parent[u]
        def union(u, v):
            pu, pv = find(u), find(v)
            if pu == pv:
                return False
            if rank[pu] < rank[pv]:
                parent[pu] = pv
            elif rank[pu] > rank[pv]:
                parent[pv] = pu
            else:
                parent[pv] = pu
                rank[pu] += 1
            return True
        mst_cost = 0
        for u, v, w in edges:
            if find(u) != find(v):
                union(u, v)
                mst_cost += w
        return mst_cost

    initial_mst_cost = find_mst(edges)
    min_operations = 0
    for i in range(m):
        u, v, w = edges[i]
        edges[i] = (u, v, w+1)
        new_mst_cost = find_mst(edges)
        if new_mst_cost == initial_mst_cost:
            min_operations += 1
        else:
            min_operations = 0
        edges[i] = (u, v, w)

    return str(min_operations)

