    def generate_formulas(s: str) -> List[str]:
        if len(s) == 1:
            return [s]
        formulas = []
        for i in range(1, len(s)):
            left, right = s[:i], s[i:]
            for left_formula in generate_formulas(left):
                for right_formula in generate_formulas(right):
                    formulas.append(f"({left_formula}+{right_formula})")
        return formulas

    s = stdin.strip()
    formulas = generate_formulas(s)
    results = [evaluate(formula) for formula in formulas]
    return sum(results)

