    t, N, M = map(int, stdin.split()[:3])
    grid = [list(line.strip()) for line in stdin.split()[3:]]
    S = []
    for i in range(N):
        for j in range(M):
            if grid[i][j] == 'S':
                S = [i, j]
                break
        if S:
            break

    def is_valid(x, y):
        return 0 <= x < N and 0 <= y < M and grid[x][y] != '1'

    def bfs(start, end):
        queue = [(start, 0)]
        visited = set()
        while queue:
            x, y, dist = queue.pop(0)
            if (x, y) in visited:
                continue
            visited.add((x, y))
            if (x, y) == end:
                return dist
            for dx, dy in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                nx, ny = x + dx, y + dy
                if is_valid(nx, ny) and (nx, ny) not in visited:
                    queue.append((nx, ny, dist + 1))
        return -1

    def find_exit():
        for i in range(N):
            for j in range(M):
                if grid[i][j] in ['U', 'D', 'L', 'R']:
                    return i, j
        return None

    exit = find_exit()
    if not exit:
        return "NOT POSSIBLE"

    exit_dist = bfs(S, exit)
    if exit_dist == -1:
        return "NOT POSSIBLE"

    escape_dist = bfs(exit, (N - 1, M - 1))
    if escape_dist == -1:
        return "NOT POSSIBLE"

    return min(exit_dist, escape_dist)

