    plaintext = plaintext.replace(' ', '').upper()

    if len(key_phrase) != 25:
        raise ValueError("Key phrase must contain 25 unique letters (excluding 'Q')")

    table = [[''] * 5 for _ in range(5)]
    for i, letter in enumerate(key_phrase):
        row, col = divmod(i, 5)
        table[row][col] = letter

    for i in range(25):
        if i not in key_phrase:
            row, col = divmod(i, 5)
            table[row][col] = chr(ord('A') + i)

    def encrypt_pair(pair: str) -> str:
        if len(pair) != 2:
            raise ValueError("Digraphs must have exactly 2 letters")

        row1, col1 = divmod(ord(pair[0]) - ord('A'), 5)
        row2, col2 = divmod(ord(pair[1]) - ord('A'), 5)

        if pair[0] == pair[1]:
            return pair[0] + 'X'
        elif row1 == row2:
            return table[row1][(col1 + 1) % 5] + table[row2][(col2 + 1) % 5]
        elif col1 == col2:
            return table[(row1 + 1) % 5][col1] + table[(row2 + 1) % 5][col2]
        else:
            return table[row1][col2] + table[row2][col1]

    encrypted_text = ''.join(encrypt_pair(plaintext[i:i+2]) for i in range(0, len(plaintext), 2))
    return encrypted_text.upper()

